import React from "react";
import { Segment } from "semantic-ui-react";

const HomeComponent = content => <Segment padded vertical attached style={ { left:'3px', right: '3px', position: 'fixed', top: '10%' }}>{content.item}</Segment>

export default HomeComponent;
